package rsn170330.lp1;

/* Test program for LP1.  Change package to your net id.
   Usage:  There are 7 tests:
	java -Xss512m -Xms2g TestLP1 0
	java -Xss512m -Xms2g TestLP1 1
	java -Xss512m -Xms2g TestLP1 2
	java -Xss512m -Xms2g TestLP1 3
	java -Xss512m -Xms2g TestLP1 4
	java -Xss512m -Xms2g TestLP1 5
	java -Xss512m -Xms2g TestLP1 6
*/

public class TestLP1 {
	public static void main(String[] args) throws Exception {
		int val = 1;
		if (args.length > 0) {
			val = Integer.parseInt(args[0]);
		}

		Timer timer = new Timer();
		switch (val) {
		case 1:
			Num x = Num.evaluatePostfix(new String[] { "98765432109876543210987654321", "5432109876543210987654321",
					"345678901234567890123456789012", "*", "+", "246801357924680135792468013579", "*",
					"12345678910111213141516171819202122", "191817161514131211109876543210", "13579", "24680", "*", "-",
					"*", "+", "7896543", "*", "157984320", "+" });
			
			print("3659535532566681673026857047264590495633096120170316011130546064934049533282760410899967541", x);
			
			print("1912991252611125159670459142926165956543555293", Num.squareRoot(x)); 
			
			System.out.println("3659535532566681673026857047264590495633096120170316011130546064934049533282760410899967541 in base 1000:");
			System.out.println("Expected output: ");
			System.out.println("1000: [541, 967, 899, 410, 760, 282, 533, 49, 934, 64, 546, 130, 11, 316, 170, 120, 96, 633, 495, 590, 264, 47, 857, 26, 673, 681, 566, 532, 535, 659, 3]");
			System.out.println("Program output: ");
			x.convertBase(1000).printList();
			System.out.println("The Number.toString(): " + x);
			System.out.println();
			
			System.out.println();
			System.out.println("3659535532566681673026857047264590495633096120170316011130546064934049533282760410899967541 in base 87654321:");
			System.out.println("Expected output: ");
			System.out.println("87654321: [22061598, 62391617, 19111561, 28159858, 28355320, 18044843, 39952418, 23667669, 1841756, 82528285, 23042337, 1559]");
			System.out.println("Program output: ");
			x.convertBase(87654321).printList();
			System.out.println("The Number.toString(): " + x);
			System.out.println();
			
			break;
		case 2:
			print("3659535532566681673026857047264590495633096120170316011130546064934049533282760410899967541", 
					Num.evaluateInfix(new String[] { "(", "(", "98765432109876543210987654321", "+", "5432109876543210987654321", "*", 
					"345678901234567890123456789012", ")", "*", "246801357924680135792468013579", "+", "12345678910111213141516171819202122", 
					"*", "(", "191817161514131211109876543210", "-", "13579", "*", "24680", ")", ")", "*", "7896543", "+", "157984320" })); 
			break;
		case 3:
			print("354224848179261915075", fibonacci(100)); 
			break;
		case 4:
			print("2597406934...653428746875", fibonacci(100000)); 
			// 
			break;
		case 5:
			print("372764047...70016204514", logFibonacci(524287)); 
			// 
			break;
		case 6: 
			print("599236705...406666667", Num.power(new Num(3), 999999)); 
			break;
		default:
			print("206", Num.evaluatePostfix(new String[] { "13", "12", "*", "48", "3", "/", "-", "66", "+" })); // 206
			break;
		}
		System.out.println(timer.end());
	}

	public static Num fibonacci(int n) {
		Num a = new Num(0);
		Num b = new Num(1);
		for (int i = 0; i < n; i++) {
			Num c = Num.add(a, b);
			a = b;
			b = c;
		}
		return a;
	}

	public static Num logFibonacci(int n) {
		int m = 1;
		Num a = new Num(1);
		Num b = a;
		Num c = a;
		Num d = new Num(0);
		Num e = null;
		while (m <= n) {
			e = quad(a, a, b, c);
			Num f = quad(a, b, b, d);
			Num g = quad(a, c, c, d);
			Num h = quad(b, c, d, d);
			a = e;
			b = f;
			c = g;
			d = h;
			m = 2 * m;
		}
		return e;
	}

	public static Num quad(Num a, Num b, Num c, Num d) {
		return Num.add(Num.product(a, b), Num.product(c, d));
	}

	public static void print(String s, Num x) {
		System.out.println("Expected output:\n" + s);
		System.out.println("Program output:");
		System.out.println(x);
		System.out.println();
	}

	public static class Timer {
		long startTime, endTime, elapsedTime, memAvailable, memUsed;

		public Timer() {
			startTime = System.currentTimeMillis();
		}

		public void start() {
			startTime = System.currentTimeMillis();
		}

		public Timer end() {
			endTime = System.currentTimeMillis();
			elapsedTime = endTime - startTime;
			memAvailable = Runtime.getRuntime().totalMemory();
			memUsed = memAvailable - Runtime.getRuntime().freeMemory();
			return this;
		}

		public String toString() {
			return "Time: " + elapsedTime + " msec.\n" + "Memory: " + (memUsed / 1048576) + " MB / "
					+ (memAvailable / 1048576) + " MB.";
		}
	}

}
